def calculate_different_ways_to_spell(N: str) -> int:
    """"""
    result = 1
    count = 1
    for i in range(1, len(N)):
        if N[i - 1] == N[i]:
            count += 1
        else:
            result *= 2 ** (count - 1)
            count = 1
    return result * 2 ** (count - 1)
